To determine how many piecences monies Hilarijai has, we start by defining the variables:
- Let \( d \) be the number of dimes.
- Let \( p \) be the number of pennies.

We know two things from the problem statement:
1. Hilarijai has twice as many pennies as dimes.
2. The total value of the monies is 75 cents.

We can express these two pieces of information as the following equations:
1. \( p = 2d \)
2. \( 10d + p = 75 \) (since each dime is worth 10 cents and each penny is worth 1 cent)

Next, we substitute the expression for \( p \) from the first equation into the second equation:
\[ 10d + 2d = 75 \]

Combine like terms:
\[ 12d = 75 \]

Solve for \( d \) by dividing both sides by 12:
\[ d = \frac{75}{12} = 6.25 \]
