1. **Set up the congruence:**
   \[
   t(t + 2) \equiv 1 \pmod{23}
   \]
   This can be expanded to:
   \[
   t^2 + 2t \equiv 1 \pmod{23}
   \]
   Rearrange the equation to form a standard quadratic congruence:
   \[
   t^2 + 2t - 1 \equiv 0 \pmod{23}
   \]

2. **Solve the quadratic congruence:**
   We can use the quadratic formula \( t = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a} \), where \( a = 1 \), \( b = 2 \), and \( c = -1 \). First, we calculate the discriminant:
   \[
   b^2 - 4ac = 2^2 - 4 \cdot 1 \cdot (-1) = 4 + 4 = 8
   \]
